self.onmessage=a=>{const{action:r,data:e}=a.data;try{let s;switch(r){case"parse":s=JSON.parse(e),self.postMessage({success:!0,data:s});break;case"format":const t=JSON.parse(e);s=JSON.stringify(t,null,2),self.postMessage({success:!0,data:s});break;case"minify":const c=JSON.parse(e);s=JSON.stringify(c),self.postMessage({success:!0,data:s});break;default:self.postMessage({success:!1,error:"Unknown action"})}}catch(s){self.postMessage({success:!1,error:s instanceof Error?s.message:"Unknown error"})}};
